"246698":{"id":"246698","name":"O Programa: A Indústria dos Internatos Abusivos","slug":"o-programa-a-industria-dos-internatos-abusivos","original_title":"The Program: Cons, Cults, and Kidnapping","overview":"Anos depois de ser enviada a um internato e ainda perturbada pelo que viveu, uma mulher decide revelar a corrupção da chamada \"indústria dos adolescentes problemáticos.\"","first_air_date":"2024-03-05","episode_run_time":0,"vote_average":7.827,"number_of_seasons":1,"number_of_episodes":3,"created_by":[],"production_companies":["Fishbowl Films"],"genres":["Documentário"],"certification":"16","backdrop_path":"https://image.tmdb.org/t/p/original/7ryi68Lx0bDcuKwun2MqDtVFsl5.jpg","poster_path":"https://image.tmdb.org/t/p/original/j499YNsEOIuW35721x3busKcE26.jpg","cast":["Katherine Kubler"],"trailer":"N/A","seasons":{"1":{"name":"Minissérie","poster_path":"https://image.tmdb.org/t/p/original/oB1aTZmgVzMu77Ry8DUyUY6cSUL.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/oB1aTZmgVzMu77Ry8DUyUY6cSUL.jpg","air_date":"2024-03-05","episode_count":3,"overview":"N/A","vote_average":7.8,"episodes":{"1":{"name":"Onde estou?","overview":"Ex-alunos da Escola Ivy Ridge voltam ao local, agora fechado, e refletem sobre o terror que enfrentaram quando participaram do programa.","air_date":"2024-03-05","runtime":63,"still_path":"https://image.tmdb.org/t/p/original/gsSYkfLleSOLspb6kR1DrQDxcWG.jpg","vote_average":8},"2":{"name":"Controle da mente","overview":"O dia a dia na Escola Ivy Ridge incluía métodos típicos de seitas, regras com punições excessivas e famílias induzidas a manter os adolescentes no programa.","air_date":"2024-03-05","runtime":63,"still_path":"https://image.tmdb.org/t/p/original/j3VtE5loIYRRVjn7nq0yiaS5GI2.jpg","vote_average":8},"3":{"name":"Na trilha do dinheiro","overview":"Com programas no mundo todo e uma mensalidade exorbitante, o dinheiro rolava solto. Mas qual era a realidade? Um rastro de operações duvidosas dá as pistas.","air_date":"2024-03-05","runtime":66,"still_path":"https://image.tmdb.org/t/p/original/uhgx412V7mlaLVEWaaCrfDcJOYE.jpg","vote_average":7.5}}}}},
"201581":{"id":"201581","name":"Querida Mamãe","slug":"querida-mamae","original_title":"Dear Mama","overview":"Uma série em cinco partes profundamente pessoal que desafia as convenções da narrativa documental tradicional para compartilhar uma saga elucidativa da relação entre Tupac Shakur e sua mãe Afeni.","first_air_date":"2023-04-21","episode_run_time":60,"vote_average":8.48,"number_of_seasons":1,"number_of_episodes":5,"created_by":[],"production_companies":["Defiant Ones Media Group","Amaru Entertainment","DreamCrew","Interscope Films","MACRO"],"genres":["Documentário"],"certification":"N/A","backdrop_path":"https://image.tmdb.org/t/p/original/yqXpdu1erQkqlzLw0Gonj5GAPeC.jpg","poster_path":"https://image.tmdb.org/t/p/original/hZ0SeunJHNurS6DtunJ1hQLnr8P.jpg","cast":["Tupac Shakur","Afeni Shakur","Gloria Cox","Eminem","Mike Tyson"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/hZ0SeunJHNurS6DtunJ1hQLnr8P.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/hZ0SeunJHNurS6DtunJ1hQLnr8P.jpg","air_date":"2023-04-21","episode_count":5,"overview":"N/A","vote_average":8.7,"episodes":{"1":{"name":"Força da Pantera","overview":"Aos 17 anos, Tupac Shakur lida com a escola, a pobreza e sua família, enquanto sonha em usar poesia e música para espalhar a mensagem de sua mãe Afeni Shakur, a famosa ativista dos Panteras Negras. Assombrada por seu passado nos Panteras Negras, Afeni teme como isso afetará o futuro promissor de Tupac.","air_date":"2023-04-21","runtime":66,"still_path":"https://image.tmdb.org/t/p/original/zCGEbe8q5f1FQSe1OwAkfviIvje.jpg","vote_average":9.462},"2":{"name":"Mudanças","overview":"Tupac estoura tanto na música quanto no cinema, mas tentar ser uma estrela e um ativista ao mesmo tempo tem seu custo. O ativismo de Afeni coloca ela e seus companheiros dos Panteras Negras no centro de um julgamento político que pode colocá-los na prisão pelo resto da vida.","air_date":"2023-04-21","runtime":61,"still_path":"https://image.tmdb.org/t/p/original/tyiSWIqbjfuWSpdxUMq9LPSJDue.jpg","vote_average":9.167},"3":{"name":"Tantas Lágrimas","overview":"Os problemas legais de Tupac aumentam e ele é preso diversas vezes em diferentes estados, culminando com sua acusação de agressão sexual em Nova York. Afeni é a voz do New York Panther 21, defendendo-se no julgamento e chocando o mundo quando o veredicto sai. O julgamento de Tupac termina da forma oposta.","air_date":"2023-04-28","runtime":50,"still_path":"https://image.tmdb.org/t/p/original/ibqBa0o8AdXAt9HT1M8CM7Tvgg7.jpg","vote_average":8},"4":{"name":"Ambitionz Az a Ridah","overview":"Tupac passa quase um ano na famosa Penitenciária Clinton, em Dannemora. Ele sai de lá mudado pela experiência e imediatamente se junta à igualmente notória Death Row Records. O contraste entre sua nova persona e sua criação como ativista é maior do que nunca, tornando sua vida cada vez mais perigosa.","air_date":"2023-05-05","runtime":64,"still_path":"https://image.tmdb.org/t/p/original/eduqoSdRM77GX2gYF1dj0JFMgbw.jpg","vote_average":8.333},"5":{"name":"Até o Fim dos Tempos","overview":"Depois de assistir a uma luta de Tyson em Las Vegas, Tupac é baleado e morto. Afeni fica paralisada pela dor de perder o filho, mas ainda consegue proteger o legado de Tupac, garantindo que sua história seja contada e que a luta continue.","air_date":"2023-05-12","runtime":50,"still_path":"https://image.tmdb.org/t/p/original/A1FQv0BmXLrFqpKWWazFrHg1wN9.jpg","vote_average":8.5}}}}},
