"229671":{"id":"229671","name":"As Garotas do Surfe - Havaí","slug":"as-garotas-do-surfe-havai","original_title":"Surf Girls Hawai'i","overview":"A nova geração de surfistas nativas havaianas compete em níveis de elite para alcançar um lugar de destaque no World Tour do surfe profissional. Esta série em quatro episódios mostra os bastidores das meninas treinando, compartilhando responsabilidades familiares e enfrentando as melhores do ranking para chegar ao pódio.","first_air_date":"2023-07-17","episode_run_time":0,"vote_average":9,"number_of_seasons":1,"number_of_episodes":4,"created_by":[],"production_companies":["Hello Sunshine","Togethxr","World Surf League"],"genres":["Documentário"],"certification":"N/A","backdrop_path":"https://image.tmdb.org/t/p/original/oUH67WC5haiAy5BzNW66UuKyYcu.jpg","poster_path":"https://image.tmdb.org/t/p/original/f9Z3TVB0RkJRKo4LGJYBlZ4d8Ui.jpg","cast":["Moana Jones Wong","Ewe Wong","Maluhia Kinimaka","Pua DeSoto","Brianna Cope"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/n7W0cI23oBAxk7rzyYpXZ6wWPpa.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/n7W0cI23oBAxk7rzyYpXZ6wWPpa.jpg","air_date":"2023-07-17","episode_count":4,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"Bem-vindos a North Shore","overview":"As Garotas do Surfe enfrentam ondas iradas e altas expectativas na lendária North Shore, em Oahu. Enquanto se preparam para a competição Sunset Pro, elas também precisam lidar com as pressões da vida familiar e dos patrocínios de elite. Em uma reviravolta de certa maneira esperada, uma novata enfrenta a Rainha da Pipeline.","air_date":"2023-07-17","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/fhKFC7VQsVVZK3yfiABPqokSVgv.jpg","vote_average":0},"2":{"name":"Furacão e Decepção","overview":"As Garotas do Surfe viajam à Flórida para participar da Super Girl Pro, mas o furacão Nicole ameaça cancelar a competição antes mesmo de ela começar. Com a vaga na Challenger Series em jogo, cada ponto conta e os riscos nunca foram tão grandes, pois elas competirão em condições meteorológicas imprevisíveis e em águas desconhecidas.","air_date":"2023-07-17","runtime":42,"still_path":"https://image.tmdb.org/t/p/original/cUR1B6vbbnvmbslSHsuIbUnQIFn.jpg","vote_average":0},"3":{"name":"Grandes Esperanças","overview":"As Garotas do Surfe voltam ao Havaí para competir no Hale'iwa Challenger, enfrentando as melhores surfistas e algumas das maiores ondas da temporada. Enquanto as grandes expectativas da família de Pua geram tensão na casa dos DeSoto, Ewe começa a brilhar sob pressão, mas uma eliminação devastadora pode ser o fim para uma das Garotas do Surfe em sua busca do primeiro lugar no pódio.","air_date":"2023-07-17","runtime":44,"still_path":"https://image.tmdb.org/t/p/original/hUs7R8bFCyuGceQ7OdwNgVtsmhE.jpg","vote_average":0},"4":{"name":"O Poder de Pipeline","overview":"As Garotas do Surfe se preparam física e mentalmente para o Pipe Masters, a competição de surfe para convidados mais icônica e perigosa do mundo, e a Rainha da Pipeline espera fazer história mais uma vez.","air_date":"2023-07-17","runtime":47,"still_path":"https://image.tmdb.org/t/p/original/fyDrcHG0B22xM7vdWObmlIoFkHG.jpg","vote_average":0}}}}},
