"134958":{"id":"134958","name":"Road Trip em Duas Rodas: Coreia","slug":"road-trip-em-duas-rodas-coreia","original_title":"먹보와 털보","overview":"Os amigos Rain e Ro Hong-chul pegam a estrada de moto para relaxar e se divertir, experimentando comidas deliciosas e explorando belas paisagens da Coreia.","first_air_date":"2021-12-11","episode_run_time":62,"vote_average":7.1,"number_of_seasons":1,"number_of_episodes":10,"created_by":["김태호"],"production_companies":[],"genres":["Reality"],"certification":"12","backdrop_path":"https://image.tmdb.org/t/p/original/2xHoTGz7eiSRrXumTnuVvIjq9EZ.jpg","poster_path":"https://image.tmdb.org/t/p/original/lTXIBpGH3ub2diJX3kbnzRroHdW.jpg","cast":["노홍철","비"],"trailer":"a-dlvwvrxsM","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/nZtBbrzcdHbuGOC3jCS4PUygoqV.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/nZtBbrzcdHbuGOC3jCS4PUygoqV.jpg","air_date":"2021-12-11","episode_count":10,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"Abril em Jeju I","overview":"Em um dia chuvoso, Rain e Hong-chul começam sua aventura sobre duas rodas na ilha de Jeju. Lee Hyo-lee e Lee Sang-soon saem para jantar com eles.","air_date":"2021-12-11","runtime":67,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"2":{"name":"Abril em Jeju II","overview":"Os amigos rodam pela costa e percorrem estradas margeadas por flores. Quem perder uma aposta terá que enfrentar uma punição e tanto.","air_date":"2021-12-11","runtime":56,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"3":{"name":"Abril em Gochang","overview":"Os tesouros naturais de Gochang aguardam os viajantes: montanhas, lamaçais e, na praia, um pôr-do-sol de tirar o fôlego.","air_date":"2021-12-11","runtime":68,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"4":{"name":"Maio em Busan I","overview":"Montados em suas Harley-Davidsons, os dois amigos passeiam por Busan e se deliciam com as especialidades locais. Em seguida, eles disputam para ver quem nada melhor.","air_date":"2021-12-11","runtime":56,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"5":{"name":"Maio em Busan II","overview":"Para Rain e Hong-chul não tem tempo ruim! Mesmo com chuva, eles aproveitam o dia na praia. Quando o céu clareia, os amigos tomam sol e passeiam de iate.","air_date":"2021-12-11","runtime":56,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"6":{"name":"Maio em Gangwon I","overview":"Os amigos viajam por estradas sinuosas para acampar nas montanhas de Gangwon-do. Para o constrangimento de Rain, Hong-chul resolve bancar o estilista por um dia.","air_date":"2021-12-11","runtime":58,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"7":{"name":"Maio em Gangwon II","overview":"A atriz Lee Ha-nee se junta a Rain e Hong-chul em um piquenique à beira de um riacho de águas límpidas. De volta ao acampamento, o trio se delicia com um jantar.","air_date":"2021-12-11","runtime":66,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"8":{"name":"Junho em Gyeongju","overview":"Na Gyeongju histórica, eles tomam um belo café da manhã e partem para um passeio turístico. Para lembrar os velhos tempos, nada melhor do que um parque de diversões.","air_date":"2021-12-11","runtime":63,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"9":{"name":"Junho em Namhae","overview":"Pilotando Triumphs, eles desfrutam de paisagens estonteantes e visitam um museu de motos. A cada curva, uma vista espetacular do oceano os aguarda.","air_date":"2021-12-11","runtime":58,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"10":{"name":"Julho em Jeju e agosto em Seul","overview":"De volta à ilha de Jeju Island, Hyo-lee e Sang-soon levam a dupla ao estúdio de gravação. Em Seul, a viagem termina com uma grata surpresa.","air_date":"2021-12-11","runtime":77,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0}}}}},
