"253990":{"id":"253990","name":"Hitler e o Nazismo: Começo, Meio e Fim","slug":"hitler-e-o-nazismo-comeco-meio-e-fim","original_title":"Hitler and the Nazis: Evil on Trial","overview":"Esta série documental mostra a ascensão de Adolf Hitler e do regime nazista desde antes da Primeira Guerra Mundial até o Julgamento de Nuremberg, passando pelo Holocausto.","first_air_date":"2024-06-05","episode_run_time":0,"vote_average":7.1,"number_of_seasons":1,"number_of_episodes":6,"created_by":[],"production_companies":["Third Eye Motion Picture Company","SMUGGLER"],"genres":["Documentário"],"certification":"16","backdrop_path":"https://image.tmdb.org/t/p/original/upmfI8Sbiv3z7vdbsmD7g4b9Puj.jpg","poster_path":"https://image.tmdb.org/t/p/original/44RUHgsM7e484aJ2rnasm52Iy9E.jpg","cast":["William L. Shirer","Károly Kozma","Imre Csók","Balázs Kató","Soma Zámbori"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/ykDva4WxCNzo8M1rYVEepoA5pFJ.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/ykDva4WxCNzo8M1rYVEepoA5pFJ.jpg","air_date":"2024-06-05","episode_count":6,"overview":"N/A","vote_average":5.1,"episodes":{"1":{"name":"Origem do mal","overview":"A infância turbulenta de Hitler na Áustria é a base para uma forte ambição política. O fim da Primeira Guerra traz uma nova era de tensão para a Alemanha.","air_date":"2024-06-05","runtime":62,"still_path":"https://image.tmdb.org/t/p/original/or8A5pVwFbwZy245r1OkbZHj6Xl.jpg","vote_average":5.6},"2":{"name":"A ascensão do Terceiro Reich","overview":"Usando a persona pública e seus leais seguidores para subir na hierarquia política, Hitler tenta estabelecer a Alemanha como uma força global em meio a uma escalada de violência.","air_date":"2024-06-05","runtime":63,"still_path":"https://image.tmdb.org/t/p/original/icdr1ohvAiwnsIljh36fK7kBTZh.jpg","vote_average":5},"3":{"name":"Hitler no poder","overview":"A propaganda nazista está a pleno vapor, com Hitler criando uma série de leis contra os judeus e trazendo sua terra natal, a Áustria, para o Terceiro Reich.","air_date":"2024-06-05","runtime":64,"still_path":"https://image.tmdb.org/t/p/original/ngb9FIhM8e2pIs4rceaQs1Jxv1.jpg","vote_average":5},"4":{"name":"O caminho para a ruína","overview":"Movido pelo poder e pelo ódio, Hitler decide expandir o território alemão, o que gera mais conquistas e a construção dos campos de concentração.","air_date":"2024-06-05","runtime":59,"still_path":"https://image.tmdb.org/t/p/original/75ro8cSbn3WVd6XZJEjTobFLv2t.jpg","vote_average":5},"5":{"name":"Crimes contra a humanidade","overview":"Com Hitler comandando as forças armadas alemãs, os nazistas invadem a União Soviética, levando aos assassinatos em massa e outros horrores do Holocausto.","air_date":"2024-06-05","runtime":66,"still_path":"https://image.tmdb.org/t/p/original/pnhrpbw2k0ye6pYsacQUsJQAy7.jpg","vote_average":5},"6":{"name":"O acerto de contas","overview":"Após a derrota da Alemanha nazista, as forças aliadas iniciam o Julgamento de Nuremberg para responsabilizar Hitler e os outros líderes do partido por seus crimes.","air_date":"2024-06-05","runtime":65,"still_path":"https://image.tmdb.org/t/p/original/54QBMaZ3sQVcriFZ00AsYjSfEli.jpg","vote_average":5}}}}},
