"202213":{"id":"202213","name":"A História do Mundo: Parte 2","slug":"a-historia-do-mundo-parte-2","original_title":"History of the World: Part II","overview":"Após mais de 40 anos de espera, finalmente temos a continuação do filme de Mel Brooks, História do Mundo, Parte I, com cada episódio apresentando diversos esquetes que nos levam a diferentes períodos da história da humanidade.","first_air_date":"2023-03-06","episode_run_time":0,"vote_average":5.6,"number_of_seasons":1,"number_of_episodes":8,"created_by":["Mel Brooks"],"production_companies":["Searchlight Television","Brooksfilms Ltd.","20th Television"],"genres":["Comédia"],"certification":"16","backdrop_path":"https://image.tmdb.org/t/p/original/1LyPGN2D5MtMeCPzmfq5QC5zaXv.jpg","poster_path":"https://image.tmdb.org/t/p/original/vQAX03ujKBp2lE42ywIVbIzm4sH.jpg","cast":["Wanda Sykes","Nick Kroll","Ike Barinholtz","Mel Brooks"],"trailer":"oYhoopPZMwA","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/vQAX03ujKBp2lE42ywIVbIzm4sH.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/vQAX03ujKBp2lE42ywIVbIzm4sH.jpg","air_date":"2023-03-06","episode_count":8,"overview":"N/A","vote_average":4.1,"episodes":{"1":{"name":"I","overview":"O General Grant sai em busca de uma bebida. Depois que o czar russo é executado, Shmuck Mudman e sua família vão para Moscou. A sala dos escritores de Shakespeare. A invenção do fogo. O VERDADEIRO Kama Sutra.","air_date":"2023-03-06","runtime":29,"still_path":"https://image.tmdb.org/t/p/original/fsiW9LgKcnT2xPh4j0NVOyRf5JU.jpg","vote_average":4.1},"2":{"name":"II","overview":"Judas trai Jesus. Shirley Chisholm faz um grande anúncio. O General Grant se vê em apuros. Marco Polo conhece Kublai Khan.","air_date":"2023-03-06","runtime":31,"still_path":"https://image.tmdb.org/t/p/original/jpBUAq8xxdxWNHlMcQuiUCaL2jt.jpg","vote_average":4.5},"3":{"name":"III","overview":"Alexander Graham Bells faz e recebe uma ligação. Shmuck Mudman ganha acesso ao politburo. Sigmund Freud ensina psicanálise.","air_date":"2023-03-07","runtime":26,"still_path":"https://image.tmdb.org/t/p/original/3r087nWP85SyfMK9gscPt7E3aXA.jpg","vote_average":4},"4":{"name":"IV","overview":"Jesus e Maria se apaixonam. Shmuck e Fanny Mudman mudam o curso da história russa. As pirâmides são construídas.","air_date":"2023-03-07","runtime":23,"still_path":"https://image.tmdb.org/t/p/original/kgreWx1Ui3vhSjFo2c9HsVDhqxI.jpg","vote_average":4},"5":{"name":"V","overview":"Galileu está no TikTok. General Grant é resgatado. Shirley Chisholm conhece George Wallace.","air_date":"2023-03-08","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/edfiqOaF6k9mI7CuCGIJkoIh4av.jpg","vote_average":4},"6":{"name":"VI","overview":"O destino de Amelia Earhart é revelado. Jesus e os Fab 13 tentam gravar o último sermão. A Guerra Civil termina e estátuas são derrubadas.","air_date":"2023-03-08","runtime":27,"still_path":"https://image.tmdb.org/t/p/original/m0uvPevxFV0yVCDLd6IFfMTfxhM.jpg","vote_average":4},"7":{"name":"VII","overview":"Paz no Oriente Médio e almoço em Oslo. Shirley Chisholm vai ao Watergate. Jesus e sua banda fazem seu último show.","air_date":"2023-03-09","runtime":27,"still_path":"https://image.tmdb.org/t/p/original/vzVqD8DcJgVAujwe2M2sC9C1csp.jpg","vote_average":4},"8":{"name":"VIII","overview":"O Muro de Berlim cai. O Cristianismo passa por uma reforma. Shirley Chisholm fala no Comitê Nacional Democrata.","air_date":"2023-03-09","runtime":22,"still_path":"https://image.tmdb.org/t/p/original/izWqVh8bseaLsXfUTbWOMif5w8g.jpg","vote_average":4}}}}},
