"92891":{"id":"92891","name":"Califado","slug":"califado","original_title":"Kalifat","overview":"Na Suécia, um ataque iminente do Estado Islâmico une os caminhos de várias mulheres. Entre elas, uma mãe em situação difícil, uma policial ambiciosa e uma estudante.","first_air_date":"2020-01-12","episode_run_time":45,"vote_average":7.3,"number_of_seasons":1,"number_of_episodes":8,"created_by":["Niklas Rockström","Wilhelm Berhman"],"production_companies":["SVT","Filmlance International","Film Capital Stockholm"],"genres":["War & Politics","Drama"],"certification":"16","backdrop_path":"https://image.tmdb.org/t/p/original/mbmFTrslrhK5UPWSF04sc5XmOhA.jpg","poster_path":"https://image.tmdb.org/t/p/original/58Zale4o8TAT0p1uje2WHr8mFA6.jpg","cast":["Gizem Erdogan","Amed Bozan","Aliette Opheim","Arvin Kananian","Amanda Sohrabi"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/ytYC71qVdXH5THNHfnDriZoLBKv.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/ytYC71qVdXH5THNHfnDriZoLBKv.jpg","air_date":"2020-01-12","episode_count":8,"overview":"Com um iminente ataque do Estado Islâmico à Suécia, os caminhos de um grupo de mulheres se cruzam. Entre elas, uma mãe com dificuldades, uma estudante e uma policial.","vote_average":6.8,"episodes":{"1":{"name":"Episódio 1","overview":"Pervin encara um dilema ao se mudar para Raqqa com o marido, que é membro do ISIS. Fatima, oficial do serviço secreto da Suécia, aproveita uma oportunidade profissional.","air_date":"2020-01-12","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/62vhLqV9FSSgesR2UWqP8QtWb94.jpg","vote_average":5.5},"2":{"name":"Episódio 2","overview":"Ibbe ilude Kerima, Sulle e Miryam com uma proposta fascinante. Fatima tenta convencer Pervin a acessar o notebook de Husam para obter mais informações sobre o ataque.","air_date":"2020-01-12","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/qbQiQdLf1mQWF5AS710cIaE1bRX.jpg","vote_average":7},"3":{"name":"Episódio 3","overview":"Pervin faz de tudo para encobrir um evento fatídico. Fatima encontra uma pista. Ibbe apresenta Sulle e Kerima a uma recrutadora do ISIS.","air_date":"2020-01-12","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/bDoUv6D9SRRG2mIB0wxND38T2W2.jpg","vote_average":7.667},"4":{"name":"Episódio 4","overview":"Myriam coloca o plano de Ibbe em ação. A investigação de Fatima encontra um obstáculo. Intenções ocultas são reveladas e Dolores faz uma descoberta chocante.","air_date":"2020-01-19","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/9bDyBLKjVcq0RS3HjWaJVllocWZ.jpg","vote_average":7},"5":{"name":"Episódio 5","overview":"Calle visita Suleiman e Tuba. Fatima ajuda Pervin a fugir de Raqqa. Kerima entrega uma surpresa de Ibbe para Sulle.","air_date":"2020-01-19","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/aLleuQjFSwAfjlYU970uzBBry7C.jpg","vote_average":7},"6":{"name":"Episódio 6","overview":"Fatima rastreia alguém que pode ter indícios importantes, mas ele está um passo à sua frente. Ansiosos, Suleiman e Calle vão para a fronteira da Síria com a Turquia.","air_date":"2020-01-26","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/xtPtEqevyyVSy5WYqqoC0zr2Eda.jpg","vote_average":7},"7":{"name":"Episódio 7","overview":"Com o destino de Lisha nas mãos, Pervin pede ajuda a Husam. Depois de seguir Jakob e Emil, Fatima apela para seu último recurso.","air_date":"2020-02-02","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/nv3SHNskn1ygWUl6pU7pbYztend.jpg","vote_average":7},"8":{"name":"Episódio 8","overview":"Nadir faz uma revelação surpreendente. Kerima se prepara para o golpe final. Fatima cumpre o acordo com Pervin, mas a que preço?","air_date":"2020-02-09","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/d3jO5hYrqWzLZN2eO3iMkc3Wf4K.jpg","vote_average":6.5}}}}},
